      SELECT DISTINCT - col2 FROM tab1 (FORMAT parquet) WHERE NULL BETWEEN ( + ( col0 ) * + ( + col0 + - ( CAST ( NULL AS INTEGER ) ) ) + + 57 * col0 ) AND + 54;
  - name: tab1

outputs:
  - name: q1617.out
    data: |
